INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 106001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2030/12/17 14:59:59", 7, 7001, 0.0, "キャル", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105901, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2030/12/17 14:59:59", 7, 7002, 0.0, "コッコロ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105801, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2030/12/17 14:59:59", 7, 7003, 0.0, "ペコリーヌ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105801, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2030/12/17 14:59:59", 10, 10001, 0.0, "ペコリーヌ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 106001, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2030/12/17 14:59:59", 10, 10002, 0.0, "キャル", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105901, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2030/12/17 14:59:59", 10, 10003, 0.0, "コッコロ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, 0, -363.0, 1, 106401, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "2030/12/17 14:59:59", 10, 10004, 0.0, "シェフィ", 0.0, "2015/12/17 15:00:00", 2, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -416.5, 1, 105801, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "2030/12/17 14:59:59", 12, 12001, 0.0, "ペコリーヌ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 106001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2030/12/17 14:59:59", 13, 13001, 0.0, "キャル", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105901, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2030/12/17 14:59:59", 13, 13002, 0.0, "コッコロ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, 0, -363.0, 1, 106401, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2030/12/17 14:59:59", 13, 13003, 0.0, "シェフィ", 0.0, "2015/12/17 15:00:00", 2, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105801, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2030/12/17 14:59:59", 13, 13004, 0.0, "ペコリーヌ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105901, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2030/12/17 14:59:59", 14, 14001, 0.0, "コッコロ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, 0, -363.0, 1, 106401, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2030/12/17 14:59:59", 14, 14002, 0.0, "シェフィ", 0.0, "2015/12/17 15:00:00", 2, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105801, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2030/12/17 14:59:59", 14, 14003, 0.0, "ペコリーヌ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 106001, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2030/12/17 14:59:59", 14, 14004, 0.0, "キャル", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -470.0, 1, 105901, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2030/12/17 14:59:59", 15, 15001, 0.0, "コッコロ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, 0, -363.0, 1, 106401, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2030/12/17 14:59:59", 16, 16001, 0.0, "シェフィ", 0.0, "2015/12/17 15:00:00", 2, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105801, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2030/12/17 14:59:59", 16, 16002, 0.0, "ペコリーヌ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 106001, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2030/12/17 14:59:59", 16, 16003, 0.0, "キャル", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105901, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2030/12/17 14:59:59", 16, 16004, 0.0, "コッコロ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105901, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2030/12/17 14:59:59", 17, 17002, 0.0, "コッコロ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 106001, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "2030/12/17 14:59:59", 25, 17004, 0.0, "キャル", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105901, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "2030/12/17 14:59:59", 25, 17005, 0.0, "コッコロ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, 0, -363.0, 1, 106401, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "2030/12/17 14:59:59", 25, 17006, 0.0, "シェフィ", 0.0, "2015/12/17 15:00:00", 2, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105801, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "2030/12/17 14:59:59", 25, 17007, 0.0, "ペコリーヌ", 0.0, "2015/12/17 15:00:00", 1, 1);
