INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 106001, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "2030/12/17 14:59:59", 21, 21001, 0.0, "キャル", 0.0, "2015/12/17 15:00:00", 1, 1);
