INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2104010, 0, -363.0, 1, 106401, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "2030/12/17 14:59:59", 21, 21003, 0.0, "シェフィ", 0.0, "2015/12/17 15:00:00", 2, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -363.0, 1, 105801, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "2030/12/17 14:59:59", 21, 21004, 0.0, "ペコリーヌ", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -430.0, 1, 190801, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "2030/12/17 14:59:59", 22, 22001, 0.0, "カリン", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -430.0, 2, 190801, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "2030/12/17 14:59:59", 22, 22002, 0.0, "カリン", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -430.0, 3, 190801, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "2030/12/17 14:59:59", 23, 23001, 0.0, "カリン", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 0, -430.0, 4, 190801, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "2030/12/17 14:59:59", 23, 23002, 0.0, "カリン", 0.0, "2015/12/17 15:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, -385.0, 1, 109001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2030/12/17 14:59:59", 24, 24001, 4.08, "エリコ（バレンタイン）", 8.0, "2019/01/31 12:00:00", 1, 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, -385.0, 2, 109001, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2030/12/17 14:59:59", 24, 24002, 5.0, "エリコ（バレンタイン）", 8.0, "2019/01/31 12:00:00", 1, 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, -385.0, 3, 109001, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2030/12/17 14:59:59", 24, 24003, 10.11, "エリコ（バレンタイン）", 8.0, "2019/01/31 12:00:00", 1, 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, -385.0, 4, 109001, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2030/12/17 14:59:59", 24, 24004, 4.0, "エリコ（バレンタイン）", 8.0, "2019/01/31 12:00:00", 1, 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, -385.0, 5, 109001, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2030/12/17 14:59:59", 24, 24005, 6.0, "エリコ（バレンタイン）", 8.0, "2019/01/31 12:00:00", 1, 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, 0.0, 6, 109002, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2030/12/17 14:59:59", 24, 24006, 0.0, "エリコ（バレンタイン）", 0.0, "2019/01/31 12:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, 0.0, 7, 109002, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2030/12/17 14:59:59", 24, 24007, 0.0, "エリコ（バレンタイン）", 0.0, "2019/01/31 12:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, 0.0, 8, 109002, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2030/12/17 14:59:59", 24, 24008, 0.0, "エリコ（バレンタイン）", 0.0, "2019/01/31 12:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, 0.0, 9, 109002, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2030/12/17 14:59:59", 24, 24009, 0.0, "エリコ（バレンタイン）", 0.0, "2019/01/31 12:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, 0.0, 10, 109002, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2030/12/17 14:59:59", 24, 24010, 0.0, "エリコ（バレンタイン）", 0.0, "2019/01/31 12:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, -385.0, 1, 109101, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2030/12/17 14:59:59", 24, 24011, 2.12, "シズル（バレンタイン）", 8.0, "2019/01/31 12:00:00", 1, 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, -385.0, 2, 109101, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2030/12/17 14:59:59", 24, 24012, 4.19, "シズル（バレンタイン）", 8.0, "2019/01/31 12:00:00", 5, 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, -385.0, 3, 109101, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "2030/12/17 14:59:59", 24, 24013, 2.3, "シズル（バレンタイン）", 8.0, "2019/01/31 12:00:00", 2, 4);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, 0.0, 4, 109102, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "2030/12/17 14:59:59", 24, 24014, 0.0, "シズル（バレンタイン）", 0.0, "2019/01/31 12:00:00", 1, 1);
