INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, 0.0, 6, 109102, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "2030/12/17 14:59:59", 24, 24016, 0.0, "シズル（バレンタイン）", 0.0, "2019/01/31 12:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, -385.0, 7, 109101, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "2030/12/17 14:59:59", 24, 24017, 5.01, "シズル（バレンタイン）", 8.0, "2019/01/31 12:00:00", 1, 2);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, 0.0, 8, 109102, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "2030/12/17 14:59:59", 24, 24018, 0.0, "シズル（バレンタイン）", 0.0, "2019/01/31 12:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, 0.0, 9, 109102, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2030/12/17 14:59:59", 24, 24019, 0.0, "シズル（バレンタイン）", 0.0, "2019/01/31 12:00:00", 1, 1);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0, 10011, 0.0, 10, 109102, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "2030/12/17 14:59:59", 24, 24020, 0.0, "シズル（バレンタイン）", 0.0, "2019/01/31 12:00:00", 1, 1);
